import React from "react";
import "./Header.scss";
import Logo from "../../../src/assets/img/Logo1.png";

export default function Header() {
  return (
    <div className="div3 ">
      <img src={Logo} className="logo" alt="Tweeter"></img>
      <p className="texto">Tweeter</p>
    </div>
  );
}
